import SidebarMenu from 'react-bootstrap-sidebar-menu';
import "react-bootstrap-sidebar-menu/dist/sidebar-menu.css";
import React from 'react';

function Sidebar(){


    return(
        <div>
            <SidebarMenu>
                <SidebarMenu.Body>
                    <SidebarMenu.Nav>
                        <SidebarMenu.Nav.Title>
                            Test
                        </SidebarMenu.Nav.Title>

                    </SidebarMenu.Nav>



                </SidebarMenu.Body>

            </SidebarMenu>

        </div>
    );
}

export default Sidebar;
